import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import './App.scss';
import Home from "./Components/Home";
function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' elements={<Home/>} />
      </Routes>
    </Router>
  );
}

export default App;
